import React from "react";
import { Form, Container } from "react-bootstrap";
import VolunteerTable from "../VolunteerTable";

const VolunteerForm = () => {
  return (
    <Container>
      <Form>
        <Form.Group>
          <Form.Label>Name</Form.Label>
          <Form.Control type="text" placeholder="Enter name" />
        </Form.Group>
        <Form.Group>
          <Form.Label>Language</Form.Label>
          <Form.Control type="text" placeholder="Enter languages spoken" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Occupation</Form.Label>
          <Form.Control type="text" placeholder="Enter occupation" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Skills</Form.Label>
          <Form.Control type="text" placeholder="Enter skills" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Role</Form.Label>
          <Form.Control type="text" placeholder="Enter role" />
        </Form.Group>
      </Form>
    </Container>
  );
};

export default VolunteerForm;
